import React, { useState, useEffect } from 'react';

export default function Alerts({ events = [], removeAlertByTs, onMonitor }) {
  // Only show primary alert events (bull/bear). Hide telegram_send / telegram status events
  const visible = (events || []).filter((ev) => {
    try {
      if (!ev || !ev.type) return false;
      const t = (ev.type || '').toString();
      // hide auxiliary telegram events
      if (t.startsWith('telegram')) return false;
      // show only bull/bear or similar alert types
      return t === 'bull' || t === 'bear' || t === 'alert';
    } catch (e) {
      return false;
    }
  });

  // manual monitor inputs (Symbol, minutes, ema1, ema2)
  const [symInput, setSymInput] = useState('');
  const [minutes, setMinutes] = useState('1');
  const [ema1, setEma1] = useState('9');
  const [ema2, setEma2] = useState('26');

  useEffect(() => {
    // prefill symbol input when possible from visible events
    try {
      if (Array.isArray(events) && events.length > 0 && !symInput) {
        const s = events[0].symbol || '';
        if (s) setSymInput(s);
      }
    } catch (e) {}
  }, [events]);

  // always render the monitor inputs (user requested beside Symbol input)

  return (
    <div className="alerts">
      <div className="alerts-title">Alerts</div>

      <div style={{ display: 'flex', gap: 8, alignItems: 'center', margin: '8px 0', flexWrap: 'wrap' }}>
        <input placeholder="Symbol" value={symInput} onChange={(e) => setSymInput(e.target.value)} style={{ padding: '6px 8px', minWidth: 120 }} />
        <input placeholder="분 (minutes)" value={minutes} onChange={(e) => setMinutes(e.target.value)} style={{ padding: '6px 8px', width: 90 }} />
        <input placeholder="EMA1" value={ema1} onChange={(e) => setEma1(e.target.value)} style={{ padding: '6px 8px', width: 120 }} />
        <input placeholder="EMA2" value={ema2} onChange={(e) => setEma2(e.target.value)} style={{ padding: '6px 8px', width: 120 }} />
        <button className="scanner-btn green" onClick={() => {
          try {
            const s = (symInput || '').toString().replace(/[^A-Za-z0-9]/g, '').toUpperCase();
            const m = Number(minutes);
            const n1 = Number(ema1);
            const n2 = Number(ema2);
            if (!s || !m || Number.isNaN(m) || Number.isNaN(n1) || Number.isNaN(n2)) return;
            if (typeof onMonitor === 'function') onMonitor({ symbol: s, minutes: m, ema1: n1, ema2: n2 });
          } catch (e) {}
        }}>Monitor</button>
      </div>

      <ul className="alerts-list">
        {visible.length === 0 ? (
          <li className="alert-item" style={{ color: '#666' }}>No alerts yet.</li>
        ) : (
          visible.map((ev, i) => (
            <li key={ev?.ts ?? i} className="alert-item">
              <div className="alert-left">
                <span className={`alert-indicator ${ev.type === 'bull' ? 'bull' : 'bear'}`} />
                <div className="alert-symbol">{ev.symbol || ''}</div>
              </div>

              <div className="alert-body">
                <div className="alert-info">
                  <div className="alert-type-short">{ev.type === 'bull' ? 'Bull' : 'Bear'}</div>
                  <div className="alert-time">{ev.time}</div>
                </div>
                <div className="alert-right">
                  <div className="alert-price">{typeof ev.price === 'number' ? ev.price : ev.price}</div>
                  <div style={{fontSize:'0.7rem', color:'#666', marginTop:4}}>{ev.source || ''}</div>
                  <button className="delete-btn" onClick={() => removeAlertByTs(ev.ts)} aria-label="삭제" title="삭제">✕</button>
                </div>
              </div>
            </li>
          ))
        )}
      </ul>
    </div>
  );
}
